import './App.css';
import {useState, useRef} from 'react';
import Carousel from './components/Carousel';
import { QueryClient, QueryClientProvider } from '@tanstack/react-query';

function App() {
  return (
    <div className="App">
        <QueryClientProvider client={queryClient}>
        <Carousel/>
      </QueryClientProvider>
    </div>
  );
}

export default App;
